webpackJsonp([0xfde360a1d40a],{341:function(e,t){e.exports={data:{post:{html:"<p>Another git problem: </p>\n<p>I come back to a project after a few days and start working on some fixes (I don't bother creating new branches for these). When I'm done and ready to commit, I go to my command line and see that I'm still in a feature branch I created a while back and haven't yet finished with. I don't want my fixes to be in this branch but in <code>master</code>. </p>\n<p>The answer's pretty simple:</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code>git stash && git checkout master && git stash pop</code></pre>\n      </div>",fields:{title:"git forgetfulness",date:"22 June, 2017",url:"http://unlikenesses.com/2017-06-22-git-forgetfulness/"}}},pathContext:{slug:"/2017-06-22-git-forgetfulness/",prev:{fields:{title:"vue transitions",date:"21 June, 2017",slug:"/2017-06-21-vue-transitions/",_PARENT:"SOURCE"},_PARENT:"SOURCE"},next:{fields:{title:"vue loader modals",date:"29 June, 2017",slug:"/2017-06-29-vue-loader-modals/",_PARENT:"SOURCE"},_PARENT:"SOURCE"},_PARENT:"SOURCE"}}}});
